import React from 'react';
import { AppBar, Toolbar, Typography, Button, IconButton, Icon } from '@mui/material';
import { makeStyles } from '@mui/styles';
import TwitterIcon from '@mui/icons-material/Twitter';
import LinkedInIcon from '@mui/icons-material/LinkedIn';

const useStyles = makeStyles((theme) => ({
  appBar: {
    backgroundColor: 'white',
    position: 'sticky',
    top: 0,
  },
  logo: {
    flexGrow: 1,
    color: 'black',
    textDecoration: 'none',
  },
  navLinks: {
    '& .MuiButton-root': {
      color: 'black',
      marginRight: theme.spacing(2),
      textDecoration: 'none',
    },
  },
}));

const NavBar = () => {
  const classes = useStyles();

  return (
    <AppBar className={classes.appBar}>
      <Toolbar>
        <Typography variant="h6" className={classes.logo}>
          Jack Retterer
        </Typography>
        <div className={classes.navLinks}>
          <Button href="#about" color="inherit">About</Button>
          <Button href="#experience" color="inherit">Experience</Button>
          <Button href="#projects" color="inherit">Projects</Button>
          <Button href="#contact" color="inherit">Contact</Button>
          <IconButton color="inherit" href="https://twitter.com/jaretterer">
            <TwitterIcon/>
          </IconButton>
          {/* <IconButton color="inherit" href="https://twitter.com/jaretterer" target="_blank" rel="noopener noreferrer">
            <TwitterIcon />
          </IconButton>
          <IconButton color="inherit" href="https://www.linkedin.com/in/jackretterer" target="_blank" rel="noopener noreferrer">
            <LinkedInIcon />
          </IconButton> */}
        </div>
      </Toolbar>
    </AppBar>
  );
};

export default NavBar;
